import React from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from './Sidebar';
import Header from './Header';
import { ArrowUpIcon, ArrowDownIcon, CurrencyDollarIcon, PlayIcon, ShoppingBagIcon, ChartBarIcon, DocumentIcon } from '@heroicons/react/24/outline';

const stats = [
  {
    name: 'Total Revenue',
    value: '$45,231.89',
    change: '+20.1%',
    changeType: 'increase',
    icon: CurrencyDollarIcon,
    link: '/revenue-analytics'
  },
  {
    name: 'Monthly Streams',
    value: '12,456',
    change: '+25.8%',
    changeType: 'increase',
    icon: PlayIcon,
  },
  {
    name: 'Sales',
    value: '1,429',
    change: '-3.2%',
    changeType: 'decrease',
    icon: ShoppingBagIcon,
  },
  {
    name: 'Conversion Rate',
    value: '4.5%',
    change: '+4.1%',
    changeType: 'increase',
    icon: ChartBarIcon,
  },
];

const recentUploads = [
  {
    id: 1,
    name: 'annual-report-2023.pdf',
    size: '2.4 MB',
    type: 'PDF',
    uploadedAt: '5 minutes ago',
  },
  {
    id: 2,
    name: 'product-preview.png',
    size: '4.8 MB',
    type: 'Image',
    uploadedAt: '10 minutes ago',
  },
  {
    id: 3,
    name: 'presentation-deck.pptx',
    size: '8.1 MB',
    type: 'PowerPoint',
    uploadedAt: '25 minutes ago',
  },
];

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="flex h-screen bg-secondary-50">
      <Sidebar />

      <div className="flex-1 flex flex-col overflow-hidden">
        <Header />

        <main className="flex-1 overflow-y-auto p-6">
          <div className="grid grid-cols-1 gap-6 md:grid-cols-2 lg:grid-cols-4">
            {stats.map((item) => (
              <div
                key={item.name}
                className={`bg-white rounded-lg shadow-sm p-6 ${
                  item.link ? 'cursor-pointer hover:shadow-md hover:bg-secondary-50 transition-all duration-200' : ''
                }`}
                onClick={() => item.link && navigate(item.link)}
              >
                <div className="flex items-center justify-between">
                  <div className="p-2 bg-primary-100 rounded-lg">
                    <item.icon className="h-6 w-6 text-primary-600" />
                  </div>
                  <div className={`flex items-center ${
                    item.changeType === 'increase' ? 'text-green-600' : 'text-red-600'
                  }`}>
                    {item.changeType === 'increase' ? (
                      <ArrowUpIcon className="h-4 w-4" />
                    ) : (
                      <ArrowDownIcon className="h-4 w-4" />
                    )}
                    <span className="text-sm font-medium ml-1">{item.change}</span>
                  </div>
                </div>
                <p className="mt-4 text-sm font-medium text-secondary-600">{item.name}</p>
                <p className="mt-2 text-2xl font-semibold text-secondary-900">{item.value}</p>
              </div>
            ))}
          </div>

          {/* Recent Uploads Section */}
          <div className="mt-6">
            <h2 className="text-lg font-medium text-secondary-900 mb-4">Recent Uploads</h2>
            <div className="bg-white rounded-lg shadow-sm overflow-hidden">
              <div className="p-6">
                <div className="space-y-6">
                  {recentUploads.map((file) => (
                    <div key={file.id} className="flex items-center justify-between">
                      <div className="flex items-center">
                        <div className="p-2 bg-primary-100 rounded-lg">
                          <DocumentIcon className="h-6 w-6 text-primary-600" />
                        </div>
                        <div className="ml-4">
                          <p className="text-sm font-medium text-secondary-900">{file.name}</p>
                          <p className="text-xs text-secondary-500">{file.uploadedAt}</p>
                        </div>
                      </div>
                      <div className="flex items-center space-x-4">
                        <span className="text-xs text-secondary-500">{file.size}</span>
                        <span className="text-xs px-2 py-1 bg-primary-100 text-primary-700 rounded-full">{file.type}</span>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
